    function loadDataTable() {
        t = $("#example1").DataTable({
            "lengthChange": false,
            "info": false,
            "language": {

                "search": "",
                "info": "Tổng số _TOTAL_ hàng",
                "infoEmpty": "",
                "infoFiltered": "",
                "paginate": {
                    "next": "»",
                    "previous": "«"
                },
                "processing": `Đang tải dữ liệu`,

                searchPlaceholder: "Tìm...",
                zeroRecords: "Không tìm thấy kết quả",

            },

            "serverSide": true,
            "processing": true,
            "ajax": {
                "url": `/NV_PhoiHopXacMinh/LoadData1?id=${s1[s1.length - 1]}`,
                "type": "POST",
                "datatype": "json",
            },

            "columns": [

                { "data": "MaKeKhai" },
                { "data": "LoaiKeKhai" },
                { "data": "NamKeKhai" },
                {
                    "data": "NgayKeKhai", "render": function (data, type, row) {
                        var date = new Date(Number(data.match(/\d+/)[0]));
                        return moment(date).format("DD/MM/YYYY")
                    }
                },
                { "data": "LinhVucKeKhai" },
                {
                    "data": "MaKeKhai", "render": function (data, type, row) {
                        return ` <span class="btn btn-outline-info btn-sm" style="width: 120px;"  onclick="loadkekhai(this)" data-model-id="${data}">
                                    Xem chi tiết
                                </span>

                                  `

                    }
                },

            ]

        });

        t.on('draw.dt', function () {
            var info = t.page.info();
            t.column(0, {search: 'applied', order: 'applied', page: 'applied' }).nodes().each(function (cell, i) {
        cell.innerHTML = i + 1 + info.start;
            });
        });

    }

