    function GuiPhanHoi(obj) {
        var MaDeNghi = s1[s1.length - 1];
        var url = `/NV_PhoiHopXacMinh/GuiPhanHoi/${Ma_CoQuan_DonVi}`
        swal.fire({
            title: 'Xác nhận',
            text: "Phản hồi đề nghị đã hoàn thành, tiến hành lưu và gửi đi",
            icon: 'warning',
            showCancelButton: true,
            confirmButtonText: 'Có, Hãy gửi!',
            cancelButtonText: 'Không, Quay lại!',
            reverseButtons: true
        }).then((result) => {
            if (result.isConfirmed) {
                $('#btnCreateKeKhaiTaiSan').click();

                $.post(url, { id: MaDeNghi })
                    .done(function (data) {
                        if (data != false) {
                            Swal.fire({
                                icon: 'success',
                                title: 'Thành Công',
                                text: `Phản hồi đã được gửi đi`,
                                timer: 2000,
                                showConfirmButton: false,
                            }).then(() => {location.reload()})
                        }
                        else {
                            Swal.fire({
                                icon: 'error',
                                title: 'Xảy ra lỗi',
                                text: `Phản hồi chưa được gửi đi`,
                                timer: 2000,
                                showConfirmButton: false,

                            })
                        }

                    })
                    .fail(function (data) {
                        Swal.fire({
                            icon: 'error',
                            title: 'Không thành công',
                            text: `Xảy ra lỗi`,
                            timer: 2000,
                            showConfirmButton: false,
                        })
                    });
            }
            else if (result.dismiss === Swal.DismissReason.cancel) {

            }
        })
    }

